import React from 'react';
import './Portfolio.css';

function Portfolio({ portfolio }) {
  if (!portfolio) {
    return <div>Loading portfolio...</div>;
  }

  const totalProfitLoss = portfolio.total_profit_loss || 0;
  const profitLossColor = totalProfitLoss >= 0 ? '#4caf50' : '#f44336';

  return (
    <div className="portfolio-card">
      <h2>Portfolio Overview</h2>

      <div className="portfolio-summary">
        <div className="summary-item">
          <span className="label">Total Value</span>
          <span className="value">${portfolio.total_value?.toFixed(2) || '0.00'}</span>
        </div>
        <div className="summary-item">
          <span className="label">Cash</span>
          <span className="value">${portfolio.cash?.toFixed(2) || '0.00'}</span>
        </div>
        <div className="summary-item">
          <span className="label">Total P&L</span>
          <span className="value" style={{ color: profitLossColor }}>
            ${totalProfitLoss.toFixed(2)}
          </span>
        </div>
      </div>

      <h3>Positions</h3>
      {!portfolio.positions || portfolio.positions.length === 0 ? (
        <p className="no-data">No positions</p>
      ) : (
        <div className="positions-table-container">
          <table className="positions-table">
            <thead>
              <tr>
                <th>Symbol</th>
                <th>Quantity</th>
                <th>Avg Price</th>
                <th>Current</th>
                <th>Value</th>
                <th>P&L</th>
                <th>P&L %</th>
              </tr>
            </thead>
            <tbody>
              {portfolio.positions.map((pos) => {
                const plColor = (pos.profit_loss || 0) >= 0 ? '#4caf50' : '#f44336';
                return (
                  <tr key={pos.symbol}>
                    <td className="symbol">{pos.symbol}</td>
                    <td>{pos.quantity}</td>
                    <td>${pos.avg_price?.toFixed(2)}</td>
                    <td>${pos.current_price?.toFixed(2)}</td>
                    <td>${pos.market_value?.toFixed(2)}</td>
                    <td style={{ color: plColor }}>
                      ${pos.profit_loss?.toFixed(2)}
                    </td>
                    <td style={{ color: plColor }}>
                      {pos.profit_loss_pct?.toFixed(2)}%
                    </td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default Portfolio;
